    async def get_signature(self):
        self.logger.info(
            f"{self.account_name} | {self.address} | {self.mint_data.name} | Getting signature..."
        )

        url = "https://www.speedtracer.xyz/api/pin-and-sign"
        headers = {"User-Agent": self.user_agent}

        attempts = random.randint(3, 30)
        path_arr, time_ms, time_s = self.calculate_route_array()
        track = "149"
        device = "Computer: 2560x1440"
        persist = False

        theme = {
            "strokeDashArray": "24,48",
            "name": "Mono",
            "font": '"Bebas Neue"',
            "background": "#0052ff",
            "crashBarrier": "#000000",
            "road": "#0052ff",
            "dash": "#ffffff",
        }

        track_image = "data:image/svg+xml;base64,"
        sender = self.address

        time.sleep(10)
        self.logger.info(
            f"{self.account_name} | {self.address} | {self.mint_data.name} | Trying to request signature..."
        )

        request_body = {
            "attempts": attempts,
            "deviceModel": device,
            "pathPoints": path_arr,
            "persist": persist,
            "sender": sender,
            "theme": theme,
            "timeInMilliseconds": time_ms,
            "timeInSeconds": time_s,
            "track": track,
            "trackImage": track_image,
        }

        proxy = self.proxy

        user_pass, ip_port = proxy.split("@")
        user, passw = user_pass.split(":")
        ip, port = ip_port.split(":")

        timeout = 300

        session_tout = aiohttp.ClientTimeout(
            total=None, sock_connect=timeout, sock_read=timeout
        )

        try:
            async with aiohttp.ClientSession(
                connector=ProxyConnector(
                    host=ip, port=port, username=user, password=passw),
                timeout=session_tout,
                headers=headers
            ) as session:

                response = await session.post(url=url, json=request_body)
                print(response.status)
                if response.status == 200:

                    data = await response.json()

                    signature = data["signature"]
                    time_mls = data["raceResult"]["timeInMilliseconds"]
                    metadata_url = data["raceResult"]["metadataUrl"]

                    return signature, time_mls, metadata_url

        except Exception:
            print(response.status)

            return
        finally:
            await session.close()

        return

    @exception_handler_with_retry
    async def mint(self):
        self.logger.info(
            f"{self.account_name} | {self.address} | {self.mint_data.name} | Starting mint run..."
        )
        res = await self.get_signature()

        if res is not None:
            signature, time_ms, metadata_url = res

        else:
            return 0

        contract_addr = Web3.to_checksum_address(
            "0xCD45E55DB12E9CA3E82370F5D0c5C6876bF6f466"
        )
        abi = '[{"inputs":[{"internalType":"bytes","name":"signature","type":"bytes"},{"components":[{"internalType":"uint128","name":"timeInMilliseconds","type":"uint128"},{"internalType":"uint32","name":"trackId","type":"uint32"},{"internalType":"address","name":"player","type":"address"},{"internalType":"string","name":"metadataUrl","type":"string"}],"internalType":"struct SpeedtracerOffseasonRaceResult.RaceResult","name":"result","type":"tuple"}],"name":"submitResult","outputs":[],"stateMutability":"payable","type":"function"}]'

        contract = self.client.get_contract(
            contract_addr=contract_addr, abi=abi)

        data = contract.encodeABI(
            fn_name="submitResult",
            args=[signature, (time_ms, 149, self.address, metadata_url)],
        )

        tx_dict = self.client.get_tx_params(
            to_address=contract_addr,
            value=0,
            data=data,
            default_gas=Mints.SpeedTracker.default_gas,
        )

        signed = self.account.sign_transaction(tx_dict)

        if signed:

            res = self.client.send_tx(signed_tx=signed)
            return res

        return
